import Items from './components/items';
export default function Product(){
    return(
        <div className='multiple-items'>
       <Items data={{                //if we use only one curly bracket then it will give error.but if we use one more curly bracket then 
        thumbnail:"image1.jpeg",    // it will consider it as a prop
        price:25000,                // At the time of calling the component which arguments we pass then react automatically set these 
        discountedPrice:20000,      // arguments in one variable this variable is called props
        title:"one plus Nord CE"
    }}/>
       <Items data={{
        thumbnail:"image2.jpeg",
        price:120000,
        discountedPrice:100000,
        title:"Apple iphone 13 pro"
    }}/>
    <Items data={{
        thumbnail:"image3.jpeg",
        price:100000,
        discountedPrice:80000,
        title:"Apple iphone 12 pro"
    }}/>
    <Items data={{
        thumbnail:"image4.jpg",
        price:70000,
        discountedPrice:50000,
        title:"one plus 10 pro"
    }}/>
    </div>  

    )
};
